import React from 'react';
import { NavLink } from 'react-router-dom';
import NavbarMenu from './NavbarMenu';
import Brand from './NavbarBrand';
import NavbarToggler from './NavbarToggler';
import './Header.css';

const menu = NavbarMenu.map(item => {
    return (<><li className="nav-item mx-3"><NavLink key={item.id} activeClassName="activePage" className="nav-link" exact to={item.path}><i className={item.icon}></i>{item.PName}</NavLink></li></>)
})

const Header = () => {
    return (<>
        <header>
            <div className="container-fluid">
                <div className="row">
                    <div className="col-lg-10 col-md-11 mx-auto">
                        <nav className="navbar navbar-expand-lg navbar-light">
                            <div className="container-fluid">
                                <Brand />

                                <div className="collapse navbar-collapse" id="navbarNav">
                                    <ul className="navbar-nav">
                                        {menu}
                                    </ul>
                                </div>
                            </div>
                        </nav>
                    </div>
                </div>
            </div>
        </header>
    </>)
}

export default Header;
